INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Error rem enim eum in.', 'Laboriosam corporis ea pariatur consequatur illo non voluptas. Dolores quo qui culpa quo optio. Culpa necessitatibus maxime quis eos laboriosam. Quaerat mollitia laborum voluptas et dolorem deleniti. Rem molestiae impedit est expedita et ut autem eveniet.', 'Optio ut at voluptate illum aliquid ipsum. Voluptas est voluptatem autem nihil sit quidem quia. Beatae accusamus unde assumenda libero.', '1979-09-15');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Veritatis corporis natus provident ratione ipsa.', 'Ipsam dolorem tempora omnis tenetur. Similique est esse omnis voluptatum.', 'Non labore sunt magni aut voluptas sit. Alias expedita dolores nihil minus hic reiciendis ut. Officia dolorem impedit a nihil a laudantium. Et minus praesentium eligendi.', '1985-03-22');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Repellat impedit ea facere enim ducimus voluptas.', 'Nihil eligendi et nihil quos amet ea voluptate. Quam animi autem a aut sit. Quo exercitationem saepe voluptatem et ut similique.', 'Nihil numquam rerum assumenda enim ut ea. Iusto nesciunt odio earum omnis qui. Sunt pariatur mollitia quod.', '1979-04-11');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 4, 'Provident dolor iure cumque necessitatibus quo repellat voluptatem quia.', 'Dolorem quam voluptatem esse aut laborum unde. Voluptate vel iure dolores quis. Enim id est velit fugit nostrum deleniti iusto unde.', 'Impedit repellat qui voluptatem iure non. Aut assumenda non eum velit sit voluptatibus eligendi enim. Necessitatibus eius perspiciatis vel praesentium.', '2002-10-26');
